settings\u0004Note: To disable a menu or:
注意：要禁用一个菜单或一个菜单项，
将其复制到用户选项并添加「disabled」键。
下面的示例将禁用「标签页」、「重启内核」以及「运行到所选单元格」项：
{
  "menus": [
    {
      "id": "jp-mainmenu-tabs",
      "disabled": true
    },
    {
      "id": "jp-mainmenu-kernel",
      "items": [
        {
          "command": "notebook:restart-and-run-to-selected",
          "disabled": true
        }
      ]
    }
  ]
}

