settings\u0004Language-server specific c:
语言服务器的设置，按实现分类，例如：

pyls: {
  serverSettings: {
    pyls: {
      plugins: {
        pydocstyle: {
          enabled: true
        },
        pyflakes: {
          enabled: false
        },
        flake8: {
          enabled: true
        }
      }
    }
  }
}

可选的，使用 VSCode 的名称转换：

pyls: {
  serverSettings: {
    "pyls.plugins.pydocstyle.enabled": true,
    "pyls.plugins.pyflakes.enabled": false,
    "pyls.plugins.flake8.enabled": true
  }
}

语言服务器的设置，按实现分类，例如：

